response.about:
Я окончил Санкт-Петербургский государственный университет. За время работы руководителем в крупных компаниях меня увлекло командообразование, и я изучил:
– коучинг (сертификат ICF);
– бизнес-коучинг (сертификат ECF);
– генеративный коучинг (сертификат OBS).
– спиральную динамику (сертификат IPMID).
Специализируюсь на управлении изменениями в бизнесе.
